import clubs from "../data/clubs.json";

const Clubs = (props) => {
  const renderMembers = () => {
    return props.item.members.map((member) => {
      return <li>{member}</li>;
    });
  };
  return (
    <article>
      <i className={props.icon}> </i>
      <h2>{props.name}</h2>
      <ul>{member} </ul>
    </article>
  );
};

export default Clubs;
